import React, { useEffect, useState } from 'react';
import jimnycarpic from "./final_jimmy_.png" 
import '../styles/home.css'
const Home = () => {
  const [persondata, setpersondata] = useState({ name: '', headline: '' });

  const helper = async () => {
    try {
      const res = await fetch('/getdata', {
        method: 'GET',
        headers: {
          'Content-Type': 'application/json',
        },
      });

      const data = await res.json();

      setpersondata({ name: data.name, headline: 'Happy to see you back' });
      console.log(data);

      if (!res.status === 200) {
        console.log('bc');
        const error = new Error(res.error);
        throw error;
      }
    } catch (err) {
      console.log(err);
      console.log('mc');
    }
  };

  useEffect(() => {
    helper();
  }, []);

  return (
    <>
       <div className="dashboard">
      <div className="pageheading">
        <h1>Dashboard</h1>
      </div>

      <div className="grid-container">
        <div className="grid-item">
          <img src="./final_jimmy_.png" alt="BigCo Inc. logo" />
        </div>

        <div className="grid-itemnew nameheading grid-container">
          <div className="textforname">
            <h3>maruti suzuki</h3>
            <h2 id="typing-heading">{typingText}</h2>
          </div>
        </div>
      </div>
    </div>
    </>
  );
};

export default Home;
